{'videoId': 'DauzsIlYmMc', 'topLevelComment': {'kind': 'youtube#comment', 'etag': 'eotKL455AjX7Od0l_AXBRmn7AWU', 'id': 'Ugx8M-62YbBUsizO31p4AaABAg', 'snippet': {'videoId': 'DauzsIlYmMc', 'textDisplay': 'E tem mais, no período da campanha de 2018 circulou um pequeno vídeo que mostrava como o nome BOLSONARO, convertido em número com base 6 dá o número do Anticristo: 666.<br>O cálculo é fácil: cada letra possui o valor numérico de sua ordem no alfabeto (A=1, B=2,.. ) A partir daí multiplicando estes números por 6, a base, e somando-os dá o total 666.<br><br>O poder espiritual por trás desse ser é enorme. Sua capacidade de se fazer adorado e  incondicionalmente seguido e defendido é inexplicável. O fascínio pode ser obra de demônios, especialmente este tipo de idolatria que vemos entre os Bolsonaristas por seu mito.', 'textOriginal': 'E tem mais, no período da campanha de 2018 circulou um pequeno vídeo que mostrava como o nome BOLSONARO, convertido em número com base 6 dá o número do Anticristo: 666.
O cálculo é fácil: cada letra possui o valor numérico de sua ordem no alfabeto (A=1, B=2,.. ) A partir daí multiplicando estes números por 6, a base, e somando-os dá o total 666.

O poder espiritual por trás desse ser é enorme. Sua capacidade de se fazer adorado e  incondicionalmente seguido e defendido é inexplicável. O fascínio pode ser obra de demônios, especialmente este tipo de idolatria que vemos entre os Bolsonaristas por seu mito.', 'authorDisplayName': 'Orlando de Souza Leão Oliveira Jr', 'authorProfileImageUrl': 'https://yt3.ggpht.com/ytc/AGIKgqMDhRlU2s5D__pv9S9CiVVaYEGLWVbkymw5fBkS=s48-c-k-c0x00ffffff-no-rj', 'authorChannelUrl': 'http://www.youtube.com/channel/UCGYoA6rTJ7q5KjTf2J8GoTA', 'authorChannelId': {'value': 'UCGYoA6rTJ7q5KjTf2J8GoTA'}, 'canRate': True, 'viewerRating': 'none', 'likeCount': 1, 'publishedAt': '2022-10-11T17:43:49Z', 'updatedAt': '2022-10-11T17:48:50Z'}}, 'canReply': True, 'totalReplyCount': 0, 'isPublic': True}
